import React from 'react'
import  './semibook.css';

const Semibooks = (props) => {
  return (
    <div className='allcontent'>

    <p>Name: {props.bookName} <br/> 
    Writer: {props.writer} <br/> 
    Price {props.price} </p>




</div>

  )
}

export default Semibooks;
